\n    When User click on Account option\r\n    And user click on existing card\r\n    And User click on remove option of card section\r\n    #Then payment details should be removed\r\n    \r\n    \r\n    @addAddress\r\n    Scenario: Verify User can add an Address\r\n    When User click on Account option\r\n    And User click on Add address option\r\n    And user fill new address form with below information\r\n    |country |fullName      |phoneNumber  |streetAddress     |apt     |city         | state |zipCode   |\r\n    |\"United States\" |Ahmad Najeem  | 9168406868   |5300 Hackberry Ln |230     |Sacramento   | Califronia    | 95828    |\r\n    And User click Add Your Address button\r\n    Then a message should be displayed 'Address Added Successfully'\r\n    \r\n    \r\n    #editAddres\r\n    @editAddress\r\n    Scenario: Verify User can edit an Address added on account\r\n    When User click on Account option\r\n    And User click on edit address option\r\n    And user fill new address form with below information\r\n    |country|fullName|phoneNumber|streetAddress|apt       |city     | state |zipCode   |\r\n    |\"United States\" |Ahmad   | 9168406868   |8861 Hackberry Ln |108    |Sacramento   | Califronia    | 95828    |\r\n    And User click update Your Address button\r\n    Then a message should be displayed ‘Address Updated Successfully’\r\n    \r\n    #RemoveAddress\r\n    @removeAddress\r\n    Scenario: Verify User can remove Address from Account\r\n    When User click on Account option\r\n    And User click on remove option of Address section\r\n    #Then Address details should be removed","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"classpath:features/RetailAccount.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@smoke","id":"ff25d58a-926d-4cd1-b54f-3c5661e68cea"}],"language":"en","keyword":"Feature","name":"Retail Account Page","description":"","children":[{"background":{"loc alse}},{"source":{"uri":"classpath:features/RetailOrder.feature","data":"@smoke\r\nFeature: Retail Order Page\r\n\r\nBackground: Retail order page\r\n    Given User is on retail website\r\n    When User click on Sign in option\r\n    And User enter email 'guardianscucumbe3@gmail.com' and password 'Guardians@a1'\r\n    And User click on login button\r\n    Then User should be logged in into Account\r\n\r\n@addItemToCart\r\nScenario: Verify User can add an item to the cart\r\n    And User changes the category to 'Smart Home'\r\n    And User searches for an item 'kasa outdoor smart plug'\r\n    And User clicks on the Search icon\r\n    And User clicks on the item\r\n    And User selects quantity '2'\r\n    And User clicks the add to Cart button\r\n    Then the cart icon quantity should change to '2'\r\n    \r\n    @addItemToCart2\r\nScenario: User can place an order with Shipping address and payment Method on file\r\n    And User changes the category on tek retail web site to 'Electronics'\r\n    And User searches on tek retail web site for an item 'Apex Legends'\r\n    And User clicks on the Search icon\r\n    And User clicks on the item search for on Tek Web\r\n    And User selects quantity '5'\r\n    And User clicks the add to Cart button\r\n    Then the cart icon quantity should change to '5'\r\n    And User clicks on the Cart option\r\n    And User clicks on the Proceed to Checkout button\r\n    And User clicks on the Place Your Order button\r\n    \r\n    @cancelOrder\r\nScenario: Verify User can cancel an order\r\n    And User clicks on the Orders section\r\n    And User clicks on the first order in the list\r\n    And User clicks on the Cancel The Order button\r\n    And User selects the cancellation reason 'Bought wrong item'\r\n    And User clicks on the Cancel Order button\r\n    Then a cancellation message should be displayed 'Your Order Has Been Cancelled'\r\n    \r\n    @returnItems\r\nScenario: Verify User can return items\r\n\t\tAnd User clicks on the Orders section\r\n    And User clicks on Return Items button\r\n    And User selects the Return Reason 'Item damaged'\r\n    And User selects the drop-off service 'FedEx'\r\n    And User clicks on the Return Order button\r\n    Then a return message should be displayed 'Return was successful'\r\n    \r\n    @addReview\r\nScenario: Verify User can add a product review\r\n    And User clicks on the Orders section\r\n    And User clicks on the first order in the list\r\n    And User clicks on the Review button\r\n    And User writes a Review headline 'Great product' and 'The product is very sturdy and very durable'\r\n    And User clicks the Add your Review button\r\n    #Then a review message should be displayed 'Your review was added successfully'\r\n    ","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"classpath:features/RetailOrder.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@smoke","id":"d52be79f-5251-4979-9e17-e7a0b357c61b"}],"language":"en","keyword":"Feature","name":"Retail Order Page","description":"","children":[{"background":{"location":{"line":4,"column":1},"keyword":"Background","name":"Retail order page","description":"","steps":[{"location":{"line":5,"column":5},"keyword":"Given ","keywordType":"Context","text":"User is on retail website","id":"eeac34a7-cca7-4c21-b40a-7a0cc1c20639"},{"location":{"line":6,"column":5},"keyword":"When ","keywordType":"Action","text":"User click on Sign in option","id":"e2a68213-6acb-48b7-bdb4-6d72bcd8f648"},{"location":{"line":7,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"User enter email 'guardianscucumbe3@gmail.com' and password 'Guardians@a1'","id":"66d4074b-29aa-4197-9703-6fa1aa30d7c7"},{"location":{"line":8,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"User click on login button","id":"eb6bd7c9-a29a-4ee4-8c98-9c34ce2a4054"},{"location":{"line":9,"column":5},"keyword":"Then ","keywordType":"Outcome"
